import React from 'react';

function OrderedList({ items }) {
    return (
      <ol>
        {items.map(item => (
          <li key={item.id}> 
            <h3>{item.name}</h3>
            <p>{item.description}</p>
          </li>
        ))}
      </ol>
    );
  }

  export default OrderedList;
